import React from "react";
import { CosValues, SinValues } from "../utility/Type";

function App() {
  const menghitungAkhirMendatar = (kecepatanAwal: number, sudut: number) => {
    const massaBola = 0.5; // kg
    const gravitasi = 9.8; // m/s^2
    const resistansiUdara = parseFloat((Math.random() * (10 - 5) + 5).toString().slice(0, 5));
    if (kecepatanAwal > 55) return "Tolong Input Kecepatan 0-55";
    if (sudut > 45) return "Tolong Input Sudut 0-45";

    const Vox = kecepatanAwal * CosValues[`COS_${sudut}` as keyof CosValues]; // rumus kecepatan mendatar
    const gayaNormal = massaBola * gravitasi; // rumus gaya normal
    const koefisienGesekan = 0.3 * gayaNormal; // koefisien gesekan 0.3 didapat dari rata-rata koefisien gesekan rumut
    const percepatanGesekan = koefisienGesekan / massaBola; // rumus percepatan gesekan
    const totalPercepatan = -(percepatanGesekan + resistansiUdara); // rumus total percepatan
    const t_darat = Vox / totalPercepatan; // t = waktu (time)
    const posisiAkhirX = Vox * t_darat + 0.5 * totalPercepatan * Math.pow(t_darat, 2); // rumus posisi akhir

    return posisiAkhirX;
  };

  const menghitungAkhirVerHori = (kecepatanAwal: number, sudut: number) => {
    const massaBola = 0.5; // kg
    const gravitasi = 9.8; // m/s^2
    const posisiAwalY = 0; // m
    const posisiAwalX = 0; // m
    if (kecepatanAwal > 55) return "Tolong Input Kecepatan 0-55";

    const Voy = kecepatanAwal * Math.sin(sudut); // rumus kecepatan vertikal
    const Vox = kecepatanAwal * Math.cos(sudut); // rumus kecepatan mendatar
    const totalPercepatanMendatar = -parseFloat((Math.random() * (10 - 5) + 5).toString().slice(0, 5)); // rumus total percepatan = -resistansi udara
    const totalPercepatanVertikal = -gravitasi; // rumus total percepatan
    const t_udara = (2 * Voy) / gravitasi; // t = waktu (time)
    const posisiAkhirX = posisiAwalX + Vox * t_udara + 0.5 * totalPercepatanMendatar * Math.pow(t_udara, 2); // rumus posisi akhir
    const posisiAkhirY = posisiAwalY + Voy * t_udara + 0.5 * totalPercepatanVertikal * Math.pow(t_udara, 2); // rumus posisi akhir vertikal\
    const titikTertinggi = posisiAwalY + Voy * (0.5 * t_udara) + 0.5 * totalPercepatanVertikal * Math.pow(0.5 * t_udara, 2); // rumus titik tertinggi = 1/2 dari posisi akhir y

    console.log({ posisiAkhirX, posisiAkhirY, titikTertinggi });
  };

  return (
    <div className="font-sans">
      <p>ea</p>
    </div>
  );
}

export default App;
